import React, { useEffect } from "react";
import { connect } from 'react-redux';

import TableCustom from '../../core/components/table/tableCustom';
import Filters from '../../core/components/filters/filters';
import { find } from '../../redux/client/client.actions';

function Clientes({ findClients, data }) {

  const filters = ['name', 'birthDate', 'gender', 'phone', 'address']

  useEffect(() => {
    findClients();
  }, [findClients]);

  return (
    <div className="Clientes">
      <div className="form">
        <Filters filters={filters}/>
      </div>
      { data ?
        ( <TableCustom data={data}/> )
      : null}
    </div >
  );
};

const mapStateToProps = (state) => {
  return {
    data: state.client.data
  };
}

const mapDispatchToProps = dispatch => ({
  findClients: item => dispatch(find())
});


export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Clientes);
